import React from "react";
import PostReduxForm from "./PostForm";

const  Posts = React.memo(props=> {
    let addPost = (state) => {
        props.addPost(state.post);
    }
    return (
        <div>
            <PostReduxForm onSubmit={addPost}/>
            {props.postsElements}
        </div>
    )
});
export default Posts;
